import Articulo from "./Articulo"
import React, { Component } from 'react'
import axios from 'axios'
import { makeStyles } from '@material-ui/core/styles';

const useStyles = makeStyles({
    card: {
      
      maxWidth: 345,
    },
    media: {
      height: 160,
    },
  });

export default class Articulos extends Component {

    

    state={
        articulos: []
      }

    GenerateArticles(props)
    {
        return(
            <React.Fragment>
                <Articulo/>
            </React.Fragment>
    
        )
    }

    componentWillMount()
    {
        axios.get('https://api.myjson.com/bins/s80td')
        .then(res=>this.setState({articulos:res.data}))
    }

    render() {
        
        return this.state.articulos.map((articulo)=>(
            <React.Fragment>
                <Articulo key={articulo.id} articulo={articulo} ver={this.props.ver} estilo={useStyles}/>
            </React.Fragment>
            
          ))
    }
}
